const navColorChanging=()=>{let n=window.pageYOffset;window.onscroll=function(){var a=window.pageYOffset;window.scrollY=0;const e=document.querySelector(".pre-nav"),o=document.querySelector("nav");n<a?(o.classList.add("active"),e.classList.add("active")):0==a&&(o.classList.remove("active"),e.classList.remove("active"),o.style.background="background:rgba(255, 255, 255, 0.199)"),n=a}},app=()=>{navColorChanging()};app();